06D\u0064\u0047\u0069\u0076\u0065\u0043\u006F\u006E\u0073\u006F\u006C\u0065(\u0043\u006F\u006E\u0073\u006F\u006C\u0065\u0053\u0079\u0073\u0074\u0065\u006D.\u0041\u0072\u0067 \u0061\u0072\u0067)        {            \u0076\u0061\u0072 \u0070\u006C\u0061\u0079\u0065\u0072 = \u0061\u0072\u0067.\u0050\u006C\u0061\u0079\u0065\u0072();            \u0069f (\u0070\u006C\u0061\u0079\u0065\u0072 != \u006E\u0075\u006C\u006C)            {                \u0069f (\u0070\u0065\u0072\u006D\u0069\u0073\u0073\u0069\u006F\u006E.\u0055\u0073\u0065\u0072\u0048\u0061\u0073\u0050\u0065\u0072\u006D\u0069\u0073\u0073\u0069\u006F\u006E(\u0070\u006C\u0061\u0079\u0065\u0072.\u0055\u0073\u0065\u0072\u0049\u0044\u0053\u0074\u0072\u0069\u006E\u0067, \u0070\u0065\u0072\u006D\u0055\u0073\u0065) == f\u0061\u006C\u0073\u0065)                {                    \u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u0061\u0072\u0067, \u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0050\u0065\u0072\u006D\u0069\u0073\u0073\u0069\u006F\u006E);                }                \u0065\u006C\u0073\u0065                {                    \u0063\u006D\u0064\u0047\u0069\u0076\u0065(\u0061\u0072\u0067, \u0061\u0072\u0067.\u0041\u0072\u0067\u0073);                }                                \u0072\u0065\u0074\u0075\u0072\u006E;            }                        \u0069f (\u0061\u0072\u0067.\u0049\u0073\u0041\u0064\u006D\u0069\u006E == \u0074\u0072\u0075\u0065)            {                \u0063\u006D\u0064\u0047\u0069\u0076\u0065(\u0061\u0072\u0067, \u0061\u0072\u0067.\u0041\u0072\u0067\u0073);            }            \u0065\u006C\u0073\u0065            {                \u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u0061\u0072\u0067, \u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0050\u0065\u0072\u006D\u0069\u0073\u0073\u0069\u006F\u006E);            }        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0063\u006D\u0064\u0047\u0069\u0076\u0065(\u006F\u0062\u006A\u0065\u0063\u0074 \u0073\u0065\u006E\u0064\u0065\u0072, \u0073\u0074\u0072\u0069\u006E\u0067[] \u0061\u0072\u0067\u0073)        {            \u0061\u0072\u0067\u0073 = \u0061\u0072\u0067\u0073 ?? \u006E\u0065\u0077 \u0073\u0074\u0072\u0069\u006E\u0067[] { };            \u0069f (\u0061\u0072\u0067\u0073.\u004C\u0065\u006E\u0067\u0074\u0068 < 2)            {                \u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u0073\u0065\u006E\u0064\u0065\u0072, \u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0055\u0073\u0061\u0067\u0065);                \u0072\u0065\u0074\u0075\u0072\u006E;            }                        \u0076\u0061\u0072 \u0074\u0061\u0072\u0067\u0065\u0074 = \u0046\u0069\u006E\u0064\u0050\u006C\u0061\u0079\u0065\u0072(\u0061\u0072\u0067\u0073[0]);            \u0076\u0061\u0072 \u0070\u006C\u0061\u0079\u0065\u0072 = \u0074\u0061\u0072\u0067\u0065\u0074 \u0061\u0073 \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072;            \u0069f (\u0070\u006C\u0061\u0079\u0065\u0072 == \u006E\u0075\u006C\u006C)            {                \u0076\u0061\u0072 \u0073\u0074\u0072 = \u0074\u0061\u0072\u0067\u0065\u0074.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();                \u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u0073\u0065\u006E\u0064\u0065\u0072, \u0073\u0074\u0072);                \u0072\u0065\u0074\u0075\u0072\u006E;            }                        \u0076\u0061\u0072 \u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065 = \u0061\u0072\u0067\u0073[1].\u0054\u006F\u004C\u006F\u0077\u0065\u0072();            \u0076\u0061\u0072 \u0069\u006Ef\u006F = \u0063\u006F\u006Ef\u0069\u0067.\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073.\u0046\u0069\u0072\u0073\u0074\u004F\u0072\u0044\u0065f\u0061\u0075\u006C\u0074(\u0078 => \u0073\u0074\u0072\u0069\u006E\u0067.\u0045\u0071\u0075\u0061\u006C\u0073(\u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065, \u0078.\u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065, \u0053\u0074\u0072\u0069\u006E\u0067\u0043\u006F\u006D\u0070\u0061\u0072\u0069\u0073\u006F\u006E.\u004F\u0072\u0064\u0069\u006E\u0061\u006C\u0049\u0067\u006E\u006F\u0072\u0065\u0043\u0061\u0073\u0065));            \u0069f (\u0069\u006Ef\u006F == \u006E\u0075\u006C\u006C)            {                \u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u0073\u0065\u006E\u0064\u0065\u0072, \u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0055\u006E\u006B\u006E\u006F\u0077\u006E\u0056\u0065\u0068\u0069\u0063\u006C\u0065, "\u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065", \u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065);                \u0072\u0065\u0074\u0075\u0072\u006E;            }                        \u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u0073\u0065\u006E\u0064\u0065\u0072, \u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0053\u0075\u0063\u0063\u0065\u0073\u0073, "\u0070\u006C\u0061\u0079\u0065\u0072", \u0070\u006C\u0061\u0079\u0065\u0072.\u0064\u0069\u0073\u0070\u006C\u0061\u0079\u004E\u0061\u006D\u0065);            \u0047\u0069\u0076\u0065\u0049\u0074\u0065\u006D(\u0070\u006C\u0061\u0079\u0065\u0072, \u0069\u006Ef\u006F);        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0047\u0069\u0076\u0065\u0049\u0074\u0065\u006D(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072, \u0056\u0065\u0068\u0069\u0063\u006C\u0065\u0045\u006E\u0074\u0072\u0079 \u0069\u006Ef\u006F)        {            \u0076\u0061\u0072 \u0069\u0074\u0065\u006D = \u0049\u0074\u0065\u006D\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0079\u004E\u0061\u006D\u0065(\u0069\u0074\u0065\u006D\u0053\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065, 1, \u0069\u006Ef\u006F.\u0073\u006B\u0069\u006E\u0049\u0044);            \u0069f (\u0069\u0074\u0065\u006D != \u006E\u0075\u006C\u006C)            {                \u0069\u0074\u0065\u006D.\u006E\u0061\u006D\u0065 = \u0069\u006Ef\u006F.\u0064\u0069\u0073\u0070\u006C\u0061\u0079\u004E\u0061\u006D\u0065;                \u0069\u0074\u0065\u006D.\u0074\u0065\u0078\u0074 = \u0069\u006Ef\u006F.\u0070\u0072\u0065f\u0061\u0062;                \u0070\u006C\u0061\u0079\u0065\u0072.\u0047\u0069\u0076\u0065\u0049\u0074\u0065\u006D(\u0069\u0074\u0065\u006D);            }        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0068\u0065\u0063\u006B\u0047\u0072\u0065\u006E\u0061\u0064\u0065(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072, \u0053\u0075\u0070\u0070\u006C\u0079\u0053\u0069\u0067\u006E\u0061\u006C \u0065\u006E\u0074\u0069\u0074\u0079, \u0054\u0068\u0072\u006F\u0077\u006E\u0057\u0065\u0061\u0070\u006F\u006E \u0077\u0065\u0061\u0070\u006F\u006E)        {            \u0076\u0061\u0072 \u0069\u0074\u0065\u006D = \u0077\u0065\u0061\u0070\u006F\u006E.\u0047\u0065\u0074\u0049\u0074\u0065\u006D();            \u0069f (\u0069\u0074\u0065\u006D == \u006E\u0075\u006C\u006C || \u0069\u0074\u0065\u006D.\u0073\u006B\u0069\u006E == 0)            {                \u0072\u0065\u0074\u0075\u0072\u006E;            }            \u0076\u0061\u0072 \u0069\u006Ef\u006F = \u0063\u006F\u006Ef\u0069\u0067.\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073.\u0046\u0069\u0072\u0073\u0074\u004F\u0072\u0044\u0065f\u0061\u0075\u006C\u0074(\u0078 => \u0078.\u0073\u006B\u0069\u006E\u0049\u0044 == \u0069\u0074\u0065\u006D.\u0073\u006B\u0069\u006E);            \u0069f (\u0069\u006Ef\u006F == \u006E\u0075\u006C\u006C)            {                \u0072\u0065\u0074\u0075\u0072\u006E;            }                        \u0076\u0061\u0072 \u0070\u0072\u0065f\u0061\u0062 = \u0069\u006Ef\u006F.\u0070\u0072\u0065f\u0061\u0062;            \u0076\u0061\u0072 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073f\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;            \u0074\u0068\u0072\u006F\u0077\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0044\u0072\u006F\u0070\u0045\u006E\u0074\u0072\u0079{\u0070\u0072\u0065f\u0061\u0062 = \u0070\u0072\u0065f\u0061\u0062, \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0064\u0065f\u0069\u006E\u0069\u0074\u0069\u006F\u006E = \u0069\u006Ef\u006F});        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0068\u0065\u0063\u006B\u0044\u0072\u006F\u0070(\u0053\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070 \u0064\u0072\u006F\u0070)        {            \u0076\u0061\u0072 \u0069\u006Ef\u006F = \u0074\u0068\u0072\u006F\u0077\u006E.\u0046\u0069\u0072\u0073\u0074\u004F\u0072\u0044\u0065f\u0061\u0075\u006C\u0074(\u0078 => \u0056\u0065\u0063\u0074\u006F\u00722\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0064\u0072\u006F\u0070.\u0074\u0072\u0061\u006E\u0073f\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0078.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) < 25f);            \u0069f (\u0069\u006Ef\u006F == \u006E\u0075\u006C\u006C)            {                \u0072\u0065\u0074\u0075\u0072\u006E;            }            \u0065\u006C\u0073\u0065            {                \u0074\u0068\u0072\u006F\u0077\u006E.\u0052\u0065\u006D\u006F\u0076\u0065(\u0069\u006Ef\u006F);            }                       \u0076\u0061\u0072 \u0065\u006E\u0074\u0069\u0074\u0079 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079(\u0069\u006Ef\u006F.\u0070\u0072\u0065f\u0061\u0062, \u0064\u0072\u006F\u0070.\u0074\u0072\u0061\u006E\u0073f\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);            \u0069f (\u0065\u006E\u0074\u0069\u0074\u0079 == \u006E\u0075\u006C\u006C)            {                \u0072\u0065\u0074\u0075\u0072\u006E;            }                        \u0064\u0072\u006F\u0070.\u004B\u0069\u006C\u006C();            \u0065\u006E\u0074\u0069\u0074\u0079.\u0053\u0070\u0061\u0077\u006E();            \u0076\u0061\u0072 \u0064\u0065f = \u0069\u006Ef\u006F.\u0064\u0065f\u0069\u006E\u0069\u0074\u0069\u006F\u006E;            \u0076\u0061\u0072 \u006F\u0062\u006A = \u0065\u006E\u0074\u0069\u0074\u0079.\u0047\u0065\u0074\u004F\u0072\u0041\u0064\u0064\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0044\u0072\u006F\u0070\u0070\u0069\u006E\u0067\u0056\u0065\u0068\u0069\u0063\u006C\u0065>();            \u0069f (\u0064\u0065f.f\u0061\u006C\u006C\u0053\u0070\u0065\u0065\u0064 > 0f)            {                \u006F\u0062\u006A.f\u0061\u006C\u006C\u0053\u0070\u0065\u0065\u0064 = \u0069\u006Ef\u006F.\u0064\u0065f\u0069\u006E\u0069\u0074\u0069\u006F\u006E.f\u0061\u006C\u006C\u0053\u0070\u0065\u0065\u0064 / 100f;            }            \u0069f (\u0064\u0065f.f\u0075\u0065\u006C\u0054\u006F\u0047\u0069\u0076\u0065 > 0)            {                \u0076\u0061\u0072 f\u0075\u0065\u006C = (\u0065\u006E\u0074\u0069\u0074\u0079 \u0061\u0073 \u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065)?.\u0047\u0065\u0074\u0046\u0075\u0065\u006C\u0053\u0079\u0073\u0074\u0065\u006D()?.\u0047\u0065\u0074\u0046\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072();                \u0069f (f\u0075\u0065\u006C != \u006E\u0075\u006C\u006C)                {                    \u0076\u0061\u0072 \u0069\u0074\u0065\u006D = \u0049\u0074\u0065\u006D\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065(f\u0075\u0065\u006C.\u0061\u006C\u006C\u006F\u0077\u0065\u0064\u0049\u0074\u0065\u006D, \u0064\u0065f.f\u0075\u0065\u006C\u0054\u006F\u0047\u0069\u0076\u0065);                    \u0069f (\u0069\u0074\u0065\u006D != \u006E\u0075\u006C\u006C)                    {                        \u0069\u0074\u0065\u006D.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(f\u0075\u0065\u006C.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079);                    }                }            }        }                \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0061\u0074\u0069\u0063 \u0043\u006F\u006Ef\u0069\u0067\u0044\u0061\u0074\u0061 \u0063\u006F\u006Ef\u0069\u0067 = \u006E\u0065\u0077 \u0043\u006F\u006Ef\u0069\u0067\u0044\u0061\u0074\u0061();        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006C\u0061\u0073\u0073 \u0043\u006F\u006Ef\u0069\u0067\u0044\u0061\u0074\u0061        {            [\u004A\u0073\u006F\u006E\u0050\u0072\u006F\u0070\u0065\u0072\u0074\u0079(\u0050\u0072\u006F\u0070\u0065\u0072\u0074\u0079\u004E\u0061\u006D\u0065 = "\u0056\u0065\u0068\u0069\u0063\u006C\u0065\u0073")]            \u0070\u0075\u0062\u006C\u0069\u0063 \u0056\u0065\u0068\u0069\u0063\u006C\u0065\u0045\u006E\u0074\u0072\u0079[] \u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073 =            {                \u006E\u0065\u0077 \u0056\u0065\u0068\u0069\u0063\u006C\u0065\u0045\u006E\u0074\u0072\u0079                {                    \u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065  = "\u0045\u0078\u0061\u006D\u0070\u006C\u0065",                    \u0064\u0069\u0073\u0070\u006C\u0061\u0079\u004E\u0061\u006D\u0065 = "\u0054\u0068\u0065\u0072\u0065 \u0061\u0072\u0065 3 \u0065\u0078\u0061\u006D\u0070\u006C\u0065 \u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073, \u0079\u006F\u0075 \u0063\u0061\u006E \u0061\u0064\u0064 \u006D\u006F\u0072\u0065!",                    \u0070\u0072\u0065f\u0061\u0062 = "\u0068\u0074\u0074\u0070://\u0062\u0069\u0074.\u006C\u0079/\u006F\u0072\u0061\u006E\u0067\u0065_\u0065\u006E\u0074\u0069\u0074\u0069\u0065\u0073",                },                \u006E\u0065\u0077 \u0056\u0065\u0068\u0069\u0063\u006C\u0065\u0045\u006E\u0074\u0072\u0079                {                    \u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065 = "\u0072\u0068\u0069\u0062",                    \u0064\u0069\u0073\u0070\u006C\u0061\u0079\u004E\u0061\u006D\u0065 = "\u004D\u0069\u006C\u0069\u0074\u0061\u0072\u0079 \u0042\u006F\u0061\u0074",                    \u0070\u0072\u0065f\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0062\u006F\u0061\u0074\u0073/\u0072\u0068\u0069\u0062/\u0072\u0068\u0069\u0062.\u0070\u0072\u0065f\u0061\u0062",                    \u0073\u006B\u0069\u006E\u0049\u0044 = 1942896432                },                \u006E\u0065\u0077 \u0056\u0065\u0068\u0069\u0063\u006C\u0065\u0045\u006E\u0074\u0072\u0079                {                    \u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065 = "\u0072\u006F\u0077\u0062\u006F\u0061\u0074",                    \u0064\u0069\u0073\u0070\u006C\u0061\u0079\u004E\u0061\u006D\u0065 = "\u0042\u006F\u0061\u0074",                    \u0070\u0072\u0065f\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0062\u006F\u0061\u0074\u0073/\u0072\u006F\u0077\u0062\u006F\u0061\u0074/\u0072\u006F\u0077\u0062\u006F\u0061\u0074.\u0070\u0072\u0065f\u0061\u0062",                    \u0073\u006B\u0069\u006E\u0049\u0044 = 1942897238                },                \u006E\u0065\u0077 \u0056\u0065\u0068\u0069\u0063\u006C\u0065\u0045\u006E\u0074\u0072\u0079                {                    \u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065 = "\u006D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072",                    \u0064\u0069\u0073\u0070\u006C\u0061\u0079\u004E\u0061\u006D\u0065 = "\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072",                    \u0070\u0072\u0065f\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u006D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072/\u006D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072.\u0065\u006E\u0074\u0069\u0074\u0079.\u0070\u0072\u0065f\u0061\u0062",                    \u0073\u006B\u0069\u006E\u0049\u0044 = 1942898011                },            };        }        \u0070\u0072\u006F\u0074\u0065\u0063\u0074\u0065\u0064 \u006F\u0076\u0065\u0072\u0072\u0069\u0064\u0065 \u0076\u006F\u0069\u0064 \u004C\u006F\u0061\u0064\u0043\u006F\u006Ef\u0069\u0067()        {            \u0062\u0061\u0073\u0065.\u004C\u006F\u0061\u0064\u0043\u006F\u006Ef\u0069\u0067();            \u0074\u0072\u0079            {                \u0063\u006F\u006Ef\u0069\u0067 = \u0043\u006F\u006Ef\u0069\u0067.\u0052\u0065\u0061\u0064\u004F\u0062\u006A\u0065\u0063\u0074<\u0043\u006F\u006Ef\u0069\u0067\u0044\u0061\u0074\u0061>();                \u0069f (\u0063\u006F\u006Ef\u0069\u0067 == \u006E\u0075\u006C\u006C)                {                    \u004C\u006F\u0061\u0064\u0044\u0065f\u0061\u0075\u006C\u0074\u0043\u006F\u006Ef\u0069\u0067();                }            }            \u0063\u0061\u0074\u0063\u0068            {                f\u006F\u0072 (\u0076\u0061\u0072 \u0069 = 0; \u0069 < 3; \u0069++)                {                    \u0050\u0072\u0069\u006E\u0074\u0045\u0072\u0072\u006F\u0072("\u0043\u006F\u006Ef\u0069\u0067\u0075\u0072\u0061\u0074\u0069\u006F\u006E f\u0069\u006C\u0065 \u0069\u0073 \u0063\u006F\u0072\u0072\u0075\u0070\u0074! \u0043\u0068\u0065\u0063\u006B \u0079\u006F\u0075\u0072 \u0063\u006F\u006Ef\u0069\u0067 f\u0069\u006C\u0065 \u0061\u0074 \u0068\u0074\u0074\u0070\u0073://\u006A\u0073\u006F\u006E\u006C\u0069\u006E\u0074.\u0063\u006F\u006D/");                }                                \u004C\u006F\u0061\u0064\u0044\u0065f\u0061\u0075\u006C\u0074\u0043\u006F\u006Ef\u0069\u0067();                \u0072\u0065\u0074\u0075\u0072\u006E;            }            \u0056\u0061\u006C\u0069\u0064\u0061\u0074\u0065\u0043\u006F\u006Ef\u0069\u0067();            \u0053\u0061\u0076\u0065\u0043\u006F\u006Ef\u0069\u0067();        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0061\u0074\u0069\u0063 \u0076\u006F\u0069\u0064 \u0056\u0061\u006C\u0069\u0064\u0061\u0074\u0065\u0043\u006F\u006Ef\u0069\u0067()        {                    }        \u0070\u0072\u006F\u0074\u0065\u0063\u0074\u0065\u0064 \u006F\u0076\u0065\u0072\u0072\u0069\u0064\u0065 \u0076\u006F\u0069\u0064 \u004C\u006F\u0061\u0064\u0044\u0065f\u0061\u0075\u006C\u0074\u0043\u006F\u006Ef\u0069\u0067()        {            \u0063\u006F\u006Ef\u0069\u0067 = \u006E\u0065\u0077 \u0043\u006F\u006Ef\u0069\u0067\u0044\u0061\u0074\u0061();        }        \u0070\u0072\u006F\u0074\u0065\u0063\u0074\u0065\u0064 \u006F\u0076\u0065\u0072\u0072\u0069\u0064\u0065 \u0076\u006F\u0069\u0064 \u0053\u0061\u0076\u0065\u0043\u006F\u006Ef\u0069\u0067()        {            \u0043\u006F\u006Ef\u0069\u0067.\u0057\u0072\u0069\u0074\u0065\u004F\u0062\u006A\u0065\u0063\u0074(\u0063\u006F\u006Ef\u0069\u0067);        }                        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u006F\u0062\u006A\u0065\u0063\u0074, \u0073\u0074\u0072\u0069\u006E\u0067> \u006C\u0061\u006E\u0067\u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0073 = \u006E\u0065\u0077 \u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u006F\u0062\u006A\u0065\u0063\u0074, \u0073\u0074\u0072\u0069\u006E\u0067>        {            {\u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0055\u0073\u0061\u0067\u0065, "\u0055\u0073\u0061\u0067\u0065:\n \u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0064\u0072\u006F\u0070\u0073.\u0067\u0069\u0076\u0065 \u0070\u006C\u0061\u0079\u0065\u0072 \u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065"},            {\u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0050\u0065\u0072\u006D\u0069\u0073\u0073\u0069\u006F\u006E, "<\u0063\u006F\u006C\u006F\u0072=#ff0000>\u0059\u006F\u0075 \u0064\u006F\u006E'\u0074 \u0068\u0061\u0076\u0065 \u0070\u0065\u0072\u006D\u0069\u0073\u0073\u0069\u006F\u006E \u0074\u006F \u0075\u0073\u0065 \u0074\u0068\u0061\u0074!</\u0063\u006F\u006C\u006F\u0072>"},            {\u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0055\u006E\u006B\u006E\u006F\u0077\u006E\u0056\u0065\u0068\u0069\u0063\u006C\u0065, "\u0055\u006E\u006B\u006E\u006F\u0077\u006E \u0076\u0065\u0068\u0069\u0063\u006C\u0065 '{\u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065}', '{\u0070\u0072\u0065f\u0061\u0062}'"},            {\u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0053\u0075\u0063\u0063\u0065\u0073\u0073, "\u0050\u006C\u0061\u0079\u0065\u0072 {\u0070\u006C\u0061\u0079\u0065\u0072} \u0073\u0075\u0063\u0063\u0065\u0073\u0073f\u0075\u006C\u006C\u0079 \u0067\u006F\u0074 \u0061\u006E \u0069\u0074\u0065\u006D!"}        };                \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0065\u006E\u0075\u006D \u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065        {            \u0053\u0075\u0063\u0063\u0065\u0073\u0073,            \u0055\u0073\u0061\u0067\u0065,            \u0050\u0065\u0072\u006D\u0069\u0073\u0073\u0069\u006F\u006E,            \u0055\u006E\u006B\u006E\u006F\u0077\u006E\u0056\u0065\u0068\u0069\u0063\u006C\u0065,        }                \u0070\u0072\u006F\u0074\u0065\u0063\u0074\u0065\u0064 \u006F\u0076\u0065\u0072\u0072\u0069\u0064\u0065 \u0076\u006F\u0069\u0064 \u004C\u006F\u0061\u0064\u0044\u0065f\u0061\u0075\u006C\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0073()        {            \u0076\u0061\u0072 \u0064\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079 = \u006E\u0065\u0077 \u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067>();            f\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0070\u0061\u0069\u0072 \u0069\u006E \u006C\u0061\u006E\u0067\u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0073)            {                \u0076\u0061\u0072 \u006B\u0065\u0079 = \u0070\u0061\u0069\u0072.\u004B\u0065\u0079.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();                \u0076\u0061\u0072 \u0076\u0061\u006C\u0075\u0065 = \u0070\u0061\u0069\u0072.\u0056\u0061\u006C\u0075\u0065;                \u0064\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079.\u0054\u0072\u0079\u0041\u0064\u0064(\u006B\u0065\u0079, \u0076\u0061\u006C\u0075\u0065);            }            \u006C\u0061\u006E\u0067.\u0052\u0065\u0067\u0069\u0073\u0074\u0065\u0072\u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0073(\u0064\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079, \u0074\u0068\u0069\u0073);        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0072\u0069\u006E\u0067 \u0047\u0065\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065 \u006B\u0065\u0079, \u0073\u0074\u0072\u0069\u006E\u0067 \u0070\u006C\u0061\u0079\u0065\u0072\u0049\u0044 = \u006E\u0075\u006C\u006C, \u0070\u0061\u0072\u0061\u006D\u0073 \u006F\u0062\u006A\u0065\u0063\u0074[] \u0061\u0072\u0067\u0073)        {            \u0076\u0061\u0072 \u006D\u0065\u0073\u0073\u0061\u0067\u0065 = \u006C\u0061\u006E\u0067.\u0047\u0065\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u006B\u0065\u0079.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067(), \u0074\u0068\u0069\u0073, \u0070\u006C\u0061\u0079\u0065\u0072\u0049\u0044);            \u0076\u0061\u0072 \u006F\u0072\u0067\u0061\u006E\u0069\u007A\u0065\u0064 = \u004F\u0072\u0067\u0061\u006E\u0069\u007A\u0065\u0041\u0072\u0067\u0073(\u0061\u0072\u0067\u0073);            \u006D\u0065\u0073\u0073\u0061\u0067\u0065 = \u0052\u0065\u0070\u006C\u0061\u0063\u0065\u0041\u0072\u0067\u0073(\u006D\u0065\u0073\u0073\u0061\u0067\u0065, \u006F\u0072\u0067\u0061\u006E\u0069\u007A\u0065\u0064);            \u0072\u0065\u0074\u0075\u0072\u006E \u006D\u0065\u0073\u0073\u0061\u0067\u0065;        }                \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0061\u0074\u0069\u0063 \u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u006F\u0062\u006A\u0065\u0063\u0074> \u004F\u0072\u0067\u0061\u006E\u0069\u007A\u0065\u0041\u0072\u0067\u0073(\u006F\u0062\u006A\u0065\u0063\u0074[] \u0061\u0072\u0067\u0073)        {            \u0076\u0061\u0072 \u0064\u0069\u0063 = \u006E\u0065\u0077 \u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u006F\u0062\u006A\u0065\u0063\u0074>();            f\u006F\u0072 (\u0076\u0061\u0072 \u0069 = 0; \u0069 < \u0061\u0072\u0067\u0073.\u004C\u0065\u006E\u0067\u0074\u0068; \u0069 += 2)            {                \u0076\u0061\u0072 \u0076\u0061\u006C\u0075\u0065 = \u0061\u0072\u0067\u0073[\u0069].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();                \u0076\u0061\u0072 \u006E\u0065\u0078\u0074\u0056\u0061\u006C\u0075\u0065 = \u0069 + 1 < \u0061\u0072\u0067\u0073.\u004C\u0065\u006E\u0067\u0074\u0068 ? \u0061\u0072\u0067\u0073[\u0069 + 1] : \u006E\u0075\u006C\u006C;                \u0064\u0069\u0063.\u0041\u0064\u0064(\u0076\u0061\u006C\u0075\u0065, \u006E\u0065\u0078\u0074\u0056\u0061\u006C\u0075\u0065);            }            \u0072\u0065\u0074\u0075\u0072\u006E \u0064\u0069\u0063;        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0061\u0074\u0069\u0063 \u0073\u0074\u0072\u0069\u006E\u0067 \u0052\u0065\u0070\u006C\u0061\u0063\u0065\u0041\u0072\u0067\u0073(\u0073\u0074\u0072\u0069\u006E\u0067 \u006D\u0065\u0073\u0073\u0061\u0067\u0065, \u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u006F\u0062\u006A\u0065\u0063\u0074> \u0061\u0072\u0067\u0073)        {            \u0069f (\u0061\u0072\u0067\u0073 == \u006E\u0075\u006C\u006C || \u0061\u0072\u0067\u0073.\u0043\u006F\u0075\u006E\u0074 < 1)            {                \u0072\u0065\u0074\u0075\u0072\u006E \u006D\u0065\u0073\u0073\u0061\u0067\u0065;            }                        f\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0070\u0061\u0069\u0072 \u0069\u006E \u0061\u0072\u0067\u0073)            {                \u0076\u0061\u0072 \u00730 = "{" + \u0070\u0061\u0069\u0072.\u004B\u0065\u0079 + "}";                \u0076\u0061\u0072 \u00731 = \u0070\u0061\u0069\u0072.\u004B\u0065\u0079;                \u0076\u0061\u0072 \u00732 = \u0070\u0061\u0069\u0072.\u0056\u0061\u006C\u0075\u0065 != \u006E\u0075\u006C\u006C ? \u0070\u0061\u0069\u0072.\u0056\u0061\u006C\u0075\u0065.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067() : "\u006E\u0075\u006C\u006C";                \u006D\u0065\u0073\u0073\u0061\u0067\u0065 = \u006D\u0065\u0073\u0073\u0061\u0067\u0065.\u0052\u0065\u0070\u006C\u0061\u0063\u0065(\u00730, \u00732, \u0053\u0074\u0072\u0069\u006E\u0067\u0043\u006F\u006D\u0070\u0061\u0072\u0069\u0073\u006F\u006E.\u0049\u006E\u0076\u0061\u0072\u0069\u0061\u006E\u0074\u0043\u0075\u006C\u0074\u0075\u0072\u0065\u0049\u0067\u006E\u006F\u0072\u0065\u0043\u0061\u0073\u0065);                \u006D\u0065\u0073\u0073\u0061\u0067\u0065 = \u006D\u0065\u0073\u0073\u0061\u0067\u0065.\u0052\u0065\u0070\u006C\u0061\u0063\u0065(\u00731, \u00732, \u0053\u0074\u0072\u0069\u006E\u0067\u0043\u006F\u006D\u0070\u0061\u0072\u0069\u0073\u006F\u006E.\u0049\u006E\u0076\u0061\u0072\u0069\u0061\u006E\u0074\u0043\u0075\u006C\u0074\u0075\u0072\u0065\u0049\u0067\u006E\u006F\u0072\u0065\u0043\u0061\u0073\u0065);            }            \u0072\u0065\u0074\u0075\u0072\u006E \u006D\u0065\u0073\u0073\u0061\u0067\u0065;        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u006F\u0062\u006A\u0065\u0063\u0074 \u0072\u0065\u0063\u0065\u0069\u0076\u0065\u0072, \u004D\u0065\u0073\u0073\u0061\u0067\u0065\u0054\u0079\u0070\u0065 \u006B\u0065\u0079, \u0070\u0061\u0072\u0061\u006D\u0073 \u006F\u0062\u006A\u0065\u0063\u0074[] \u0061\u0072\u0067\u0073)        {            \u0076\u0061\u0072 \u0075\u0073\u0065\u0072\u0049\u0044 = (\u0072\u0065\u0063\u0065\u0069\u0076\u0065\u0072 \u0061\u0073 \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072)?.\u0055\u0073\u0065\u0072\u0049\u0044\u0053\u0074\u0072\u0069\u006E\u0067;            \u0076\u0061\u0072 \u006D\u0065\u0073\u0073\u0061\u0067\u0065 = \u0047\u0065\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u006B\u0065\u0079, \u0075\u0073\u0065\u0072\u0049\u0044, \u0061\u0072\u0067\u0073);            \u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u0072\u0065\u0063\u0065\u0069\u0076\u0065\u0072, \u006D\u0065\u0073\u0073\u0061\u0067\u0065);        }                \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u006F\u0062\u006A\u0065\u0063\u0074 \u0072\u0065\u0063\u0065\u0069\u0076\u0065\u0072, \u0073\u0074\u0072\u0069\u006E\u0067 \u006D\u0065\u0073\u0073\u0061\u0067\u0065)        {            \u0069f (\u0072\u0065\u0063\u0065\u0069\u0076\u0065\u0072 == \u006E\u0075\u006C\u006C)            {                \u0072\u0065\u0074\u0075\u0072\u006E;            }                        \u0076\u0061\u0072 \u0063\u006F\u006E\u0073\u006F\u006C\u0065 = \u0072\u0065\u0063\u0065\u0069\u0076\u0065\u0072 \u0061\u0073 \u0043\u006F\u006E\u0073\u006F\u006C\u0065\u0053\u0079\u0073\u0074\u0065\u006D.\u0041\u0072\u0067;            \u0069f (\u0063\u006F\u006E\u0073\u006F\u006C\u0065 != \u006E\u0075\u006C\u006C)            {                \u0053\u0065\u006E\u0064\u0052\u0065\u0070\u006C\u0079(\u0063\u006F\u006E\u0073\u006F\u006C\u0065, \u006D\u0065\u0073\u0073\u0061\u0067\u0065);                \u0072\u0065\u0074\u0075\u0072\u006E;            }                        \u0076\u0061\u0072 \u0070\u006C\u0061\u0079\u0065\u0072 = \u0072\u0065\u0063\u0065\u0069\u0076\u0065\u0072 \u0061\u0073 \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072;            \u0069f (\u0070\u006C\u0061\u0079\u0065\u0072 != \u006E\u0075\u006C\u006C)            {                \u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u006D\u0065\u0073\u0073\u0061\u0067\u0065);                \u0072\u0065\u0074\u0075\u0072\u006E;            }        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u006F\u0062\u006A\u0065\u0063\u0074 \u0046\u0069\u006E\u0064\u0050\u006C\u0061\u0079\u0065\u0072(\u0073\u0074\u0072\u0069\u006E\u0067 \u0074\u0061\u0072\u0067\u0065\u0074\u004E\u0061\u006D\u0065)        {            \u0076\u0061\u0072 \u006D\u0061\u0074\u0063\u0068 = \u006E\u0065\u0077 \u0050\u0072\u0065\u0064\u0069\u0063\u0061\u0074\u0065<\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072>(\u0078 => \u0078.\u0055\u0073\u0065\u0072\u0049\u0044\u0053\u0074\u0072\u0069\u006E\u0067 == \u0074\u0061\u0072\u0067\u0065\u0074\u004E\u0061\u006D\u0065 || \u0078.\u0064\u0069\u0073\u0070\u006C\u0061\u0079\u004E\u0061\u006D\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0074\u0061\u0072\u0067\u0065\u0074\u004E\u0061\u006D\u0065, \u0043\u006F\u006D\u0070\u0061\u0072\u0065\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u0049\u0067\u006E\u006F\u0072\u0065\u0043\u0061\u0073\u0065));            \u0076\u0061\u0072 \u0074\u0061\u0072\u0067\u0065\u0074\u0073 = \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0061\u0063\u0074\u0069\u0076\u0065\u0050\u006C\u0061\u0079\u0065\u0072\u004C\u0069\u0073\u0074.\u0057\u0068\u0065\u0072\u0065(\u0078 => \u006D\u0061\u0074\u0063\u0068(\u0078)) .\u0054\u006F\u0041\u0072\u0072\u0061\u0079();            \u0069f (\u0074\u0061\u0072\u0067\u0065\u0074\u0073.\u004C\u0065\u006E\u0067\u0074\u0068 == 0)            {                \u0072\u0065\u0074\u0075\u0072\u006E $"\u0054\u0068\u0065\u0072\u0065 \u0061\u0072\u0065 \u006E\u006F \u0070\u006C\u0061\u0079\u0065\u0072\u0073 \u0077\u0069\u0074\u0068 \u0074\u0068\u0061\u0074 '\u004E\u0061\u006D\u0065' \u006F\u0072 '\u0053\u0074\u0065\u0061\u006D \u0049\u0044' ({\u0074\u0061\u0072\u0067\u0065\u0074\u004E\u0061\u006D\u0065})";            }            \u0069f (\u0074\u0061\u0072\u0067\u0065\u0074\u0073.\u004C\u0065\u006E\u0067\u0074\u0068 > 1)            {                \u0072\u0065\u0074\u0075\u0072\u006E $"\u0054\u0068\u0065\u0072\u0065 \u0061\u0072\u0065 \u006D\u0075\u006C\u0074\u0069\u0070\u006C\u0065 \u0070\u006C\u0061\u0079\u0065\u0072\u0073 \u0077\u0069\u0074\u0068 \u0074\u0068\u0061\u0074 '\u004E\u0061\u006D\u0065' :\n{\u0074\u0061\u0072\u0067\u0065\u0074\u0073.\u0053\u0065\u006C\u0065\u0063\u0074(\u0078 => \u0078.\u0064\u0069\u0073\u0070\u006C\u0061\u0079\u004E\u0061\u006D\u0065).\u0054\u006F\u0053\u0065\u006E\u0074\u0065\u006E\u0063\u0065()}";            }            \u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0061\u0072\u0067\u0065\u0074\u0073[0];        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0061\u0074\u0069\u0063 f\u006C\u006F\u0061\u0074 \u0056\u0065\u0063\u0074\u006F\u00722\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u00731, \u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u00732)        {            \u0076\u0061\u0072 \u0070\u006F\u00733 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00722(\u0070\u006F\u00731.\u0078, \u0070\u006F\u00732.\u007A);            \u0076\u0061\u0072 \u0070\u006F\u00734 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00722(\u0070\u006F\u00732.\u0078, \u0070\u006F\u00732.\u007A);            \u0072\u0065\u0074\u0075\u0072\u006E \u0056\u0065\u0063\u0074\u006F\u00722.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0070\u006F\u00733, \u0070\u006F\u00734);        }        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006C\u0061\u0073\u0073 \u0044\u0072\u006F\u0070\u0070\u0069\u006E\u0067\u0056\u0065\u0068\u0069\u0063\u006C\u0065 : \u004D\u006F\u006E\u006F\u0042\u0065\u0068\u0061\u0076\u0069\u006F\u0075\u0072        {            \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065 \u0076\u0065\u0068\u0069\u0063\u006C\u0065;            \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065;            \u0070\u0075\u0062\u006C\u0069\u0063 f\u006C\u006F\u0061\u0074 f\u0061\u006C\u006C\u0053\u0070\u0065\u0065\u0064;            \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0041\u0077\u0061\u006B\u0065()            {                \u0076\u0065\u0068\u0069\u0063\u006C\u0065 = \u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065>();            }            \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0074\u0061\u0072\u0074()            {                \u0041\u0064\u0064\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065();            }                        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0044\u0065\u0073\u0074\u0072\u006F\u0079()            {                \u0052\u0065\u006D\u006F\u0076\u0065\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065();            }            \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0041\u0064\u0064\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065()            {                \u0069f (\u0076\u0065\u0068\u0069\u0063\u006C\u0065.\u0072\u0069\u0067\u0069\u0064\u0042\u006F\u0064\u0079 != \u006E\u0075\u006C\u006C)                {                    \u0076\u0065\u0068\u0069\u0063\u006C\u0065.\u0072\u0069\u0067\u0069\u0064\u0042\u006F\u0064\u0079.\u0075\u0073\u0065\u0047\u0072\u0061\u0076\u0069\u0074\u0079 = f\u0061\u006C\u0073\u0065;                }                                \u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079(\u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065\u0050\u0072\u0065f\u0061\u0062);                \u0069f (\u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065 != \u006E\u0075\u006C\u006C)                {                    \u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0076\u0065\u0068\u0069\u0063\u006C\u0065, "\u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065_\u0061\u0074\u0074\u0061\u0063\u0068");                    \u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065.\u0053\u0070\u0061\u0077\u006E();                }            }            \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0052\u0065\u006D\u006F\u0076\u0065\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065()            {                \u0069f (\u0076\u0065\u0068\u0069\u0063\u006C\u0065.\u0049\u0073\u0056\u0061\u006C\u0069\u0064() == \u0074\u0072\u0075\u0065 && \u0076\u0065\u0068\u0069\u0063\u006C\u0065.\u0072\u0069\u0067\u0069\u0064\u0042\u006F\u0064\u0079 != \u006E\u0075\u006C\u006C)                {                    \u0076\u0065\u0068\u0069\u0063\u006C\u0065.\u0072\u0069\u0067\u0069\u0064\u0042\u006F\u0064\u0079.\u0075\u0073\u0065\u0047\u0072\u0061\u0076\u0069\u0074\u0079 = \u0074\u0072\u0075\u0065;                }                                \u0069f (\u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065.\u0049\u0073\u0056\u0061\u006C\u0069\u0064() == \u0074\u0072\u0075\u0065)                {                    \u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065.\u004B\u0069\u006C\u006C();                    \u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065 = \u006E\u0075\u006C\u006C;                }            }                        \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0043\u006F\u006C\u006C\u0069\u0073\u0069\u006F\u006E\u0045\u006E\u0074\u0065\u0072(\u0043\u006F\u006C\u006C\u0069\u0073\u0069\u006F\u006E \u0063\u006F\u006C\u006C\u0069\u0073\u0069\u006F\u006E)            {                \u0044\u0065\u0073\u0074\u0072\u006F\u0079(\u0074\u0068\u0069\u0073);            }            \u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0046\u0069\u0078\u0065\u0064\u0055\u0070\u0064\u0061\u0074\u0065()            {                \u0069f (\u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065.\u0049\u0073\u0056\u0061\u006C\u0069\u0064() == \u0074\u0072\u0075\u0065)                {                    \u0076\u0065\u0068\u0069\u0063\u006C\u0065.\u0074\u0072\u0061\u006E\u0073f\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E -= \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, f\u0061\u006C\u006C\u0053\u0070\u0065\u0065\u0064 * 10f * \u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065, 0);                }            }        }    }